import styled from 'styled-components';

export const AreaHeader = styled.div`

        background-color: #0B63CE;
        height: 61px;
        
        
        

       

        @media only screen and (max-width: 926px) {
            .areas {
                flex-direction: column;
            }
        
            .search-text {
                max-width: 100px;
            }
        
            .buttons {
                position: relative;
                right: 90px;
            }
        
            header {
                height: 95px;
            }
        
            #select-label {
                margin-right: 100px;
            }
        
            #addElementBtn {
                margin-left: 5px;
            }
        
            .box-btn-add {
                max-width: 300px;
                margin-left: 28%;
            }
        
            .logo-img {
                padding-right: 10px;
        
            }
        
            .footer-info {
                flex-direction: column;
                padding-left: 0;
            }
        
            .footer-info ul {
                width: 100%;
                margin-bottom: 30px;
            }
        
            .by-lf {
                flex-direction: column;
            }
        
            .current-language {
                position: relative;
                width: 20%;
                left: 27px;
                bottom: 40px;
        
            }
        
            .redes-sociais {
                bottom: 0;
            }
        
            .call-center {
                bottom: 0;
            }
        }
        
        @media only screen and (max-width: 1260px) {
        
            .footer-info {
                margin-right: 80px;
            }
        }


`;
